// Current language - default to English
let currentLang = 'en';
let invitationType = 'reception';

document.addEventListener('DOMContentLoaded', function() {
  // Get URL parameters
  const urlParams = new URLSearchParams(window.location.search);

  // Set language from URL if provided
  if (urlParams.has('lang')) {
    const langParam = urlParams.get('lang').toLowerCase();
    if (translations[langParam]) {
      currentLang = langParam;
    }
  }

  const typeParam = urlParams.get('type');
  if (typeParam === 'full') {
    invitationType = 'full';
  }

  // Apply translations
  applyTranslations();

  // Set up event listeners
  document.getElementById('submitPassword').addEventListener('click', function() {
    checkPassword(document.getElementById('passwordInput').value);
  });

  document.getElementById('passwordInput').addEventListener('keyup', function(event) {
    if (event.key === 'Enter') {
      checkPassword(document.getElementById('passwordInput').value);
    }
  });

  // Check for password in URL query params
  const passwordParam = urlParams.get('password');

  if (passwordParam) {

    // Check password from URL
    checkPassword(passwordParam);
  } else {
    // Check for saved authentication
    checkSavedAuth();
  }
});

function initImageCarousel(images) {
  if (!images || images.length === 0) return;

  const carousel = document.querySelector('.carousel-slides');
  const dotsContainer = document.querySelector('.carousel-dots');

  // Clear existing content
  carousel.innerHTML = '';
  dotsContainer.innerHTML = '';

  // Create slides from encrypted images
  images.forEach((imgBase64, index) => {
    // Create slide
    const slide = document.createElement('div');
    slide.className = 'carousel-slide';
    slide.style.backgroundImage = `url(${imgBase64})`;
    carousel.appendChild(slide);

    // Create dot
    const dot = document.createElement('div');
    dot.className = index === 0 ? 'dot active' : 'dot';
    dot.dataset.index = index;
    dotsContainer.appendChild(dot);
  });

  // Set up navigation
  let currentSlide = 0;

  function goToSlide(index) {
    carousel.style.transform = `translateX(-${index * 100}%)`;

    // Update dots
    document.querySelectorAll('.dot').forEach((dot, i) => {
      dot.classList.toggle('active', i === index);
    });

    currentSlide = index;
  }

  // Set up event listeners
  document.querySelector('.next-btn').addEventListener('click', () => {
    const nextSlide = (currentSlide + 1) % images.length;
    goToSlide(nextSlide);
  });

  document.querySelector('.prev-btn').addEventListener('click', () => {
    const prevSlide = (currentSlide - 1 + images.length) % images.length;
    goToSlide(prevSlide);
  });

  // Dot navigation
  document.querySelectorAll('.dot').forEach(dot => {
    dot.addEventListener('click', () => {
      goToSlide(parseInt(dot.dataset.index));
    });
  });

  // Auto-advance slides every 5 seconds
  setInterval(() => {
    const nextSlide = (currentSlide + 1) % images.length;
    goToSlide(nextSlide);
  }, 5000);
}

/**
 * Check if user has previously authenticated and stored in localStorage
 */
function checkSavedAuth() {
    const savedAuth = localStorage.getItem('weddingAuth');
    if (savedAuth === 'true') {
        showInvitation();
    }
}

/**
 * Verify password and decrypt data
 */
async function checkPassword(password) {

  try {
    // This is where your bcrypt hash goes
    const storedHash = '$2a$10$uD6xbEdq.PBC6slsJ.BB1.lxDeiQe8UUQsftOmqvqIxVBXdCUuF8K';

    // Check password with bcrypt
    const isMatch = await dcodeIO.bcrypt.compare(password, storedHash);

    if (isMatch) {
      // Decrypt the wedding data
      const decryptedData = await decryptData(encryptedWeddingData, password);

      if (decryptedData) {
        // Populate the invitation with decrypted data
        populateInvitation(decryptedData);

        // Save authentication status
        localStorage.setItem('weddingAuth', 'true');

        // Show the invitation
        showInvitation();
      } else {
        alert('Error decrypting data. Please try again.');
      }
    } else {
      alert('Incorrect password. Please try again.');
    }
  } catch (error) {
    console.error('Error verifying password:', error);
    alert('There was an error checking the password. Please try again.');
  }
}

/**
 * Fill in invitation with decrypted data
 */
function populateInvitation(data) {

  console.log("populating data")

  // Names
  document.querySelector('.names').innerHTML = `
    <span class="accent">${data.name1}</span>
    <span> & </span>
    <span class="accent">${data.name2}</span>
  `;

  let ceremonyDate = data.date.replace(/\n/g, '<br>')
  if (currentLang === 'en') {
    ceremonyDate = ceremonyDate.replace("Juli", "July")
  }

  let receptionDate = data.receptionDate.replace(/\n/g, '<br>')
    if (currentLang === 'en') {
      receptionDate = receptionDate.replace("Juli", "July")
    }

  // Location
  document.querySelector('.ceremony-location').innerHTML = data.location.replace(/\n/g, '<br>');
  document.querySelector('.ceremony-date').innerHTML = ceremonyDate;
  document.querySelector('.reception-location').innerHTML = data.receptionLocation.replace(/\n/g, '<br>');
  document.querySelector('.reception-date').innerHTML = receptionDate;

  // RSVP
  document.querySelector('.rsvp').href = `mailto:${data.rsvpEmail}?subject=Wedding%20RSVP`;
  document.querySelector('.rsvp').textContent = `RSVP by ${data.rsvpDeadline}`;

  if (data.images && data.images.length > 0) {
    document.querySelector('.image-carousel').style.display = 'block';
    initImageCarousel(data.images);
  } else {
    document.querySelector('.image-carousel').style.display = 'none';
  }

    if (data.accommodations && data.accommodations.length > 0) {
    document.querySelector('.accommodation-section').style.display = 'block';
    initAccommodations(data.accommodations);
  } else {
    document.querySelector('.accommodation-section').style.display = 'none';
  }
}

function initAccommodations(accommodations) {
  if (!accommodations || accommodations.length === 0) return;

  // Get DOM elements
  const accommodationBtn = document.getElementById('showAccommodations');
  const accommodationDetails = document.getElementById('accommodationDetails');
  const accommodationList = document.getElementById('accommodationList');

  // Toggle functionality
  accommodationBtn.addEventListener('click', function() {
    accommodationDetails.classList.toggle('open');
    accommodationBtn.classList.toggle('active');
  });

  // Populate accommodation list
  accommodationList.innerHTML = '';
  accommodations.forEach(hotel => {
    const hotelCard = document.createElement('div');
    hotelCard.className = 'hotel-card';

    hotelCard.innerHTML = `
      <div class="hotel-name">
        <a href="${hotel.link}" target="_blank" class="hotel-link">${hotel.name}</a>
      </div>
      <div class="hotel-contact">
        <div>${hotel.email}</div>
        <div>${hotel.phoneNumber}</div>
      </div>
      <div class="hotel-map">
        <a href="${hotel.mapLink}" target="_blank" class="map-link">
          ${translations[currentLang].viewMap}
        </a>
      </div>
    `;

    accommodationList.appendChild(hotelCard);
  });
}


// Decrypt data with password
async function decryptData(encryptedData, password) {
  try {
    const encoder = new TextEncoder();

    // Convert from base64
    const binaryString = atob(encryptedData);
    const bytes = new Uint8Array(binaryString.length);
    for (let i = 0; i < binaryString.length; i++) {
      bytes[i] = binaryString.charCodeAt(i);
    }

    // Extract salt, iv, and ciphertext
    const salt = bytes.slice(0, 16);
    const iv = bytes.slice(16, 28);
    const ciphertext = bytes.slice(28);

    // Recreate key from password
    const keyMaterial = await window.crypto.subtle.importKey(
      'raw',
      encoder.encode(password),
      { name: 'PBKDF2' },
      false,
      ['deriveBits', 'deriveKey']
    );

    const key = await window.crypto.subtle.deriveKey(
      {
        name: 'PBKDF2',
        salt,
        iterations: 100000,
        hash: 'SHA-256'
      },
      keyMaterial,
      { name: 'AES-GCM', length: 256 },
      false,
      ['decrypt']
    );

    // Decrypt
    const decrypted = await window.crypto.subtle.decrypt(
      { name: 'AES-GCM', iv },
      key,
      ciphertext
    );

    // Decode JSON
    const decoder = new TextDecoder();
    return JSON.parse(decoder.decode(decrypted));
  } catch (error) {
    console.error('Decryption failed:', error);
    return null;
  }
}

function applyTranslations() {
  // Password section
  document.querySelector('#passwordSection h1').textContent = translations[currentLang].passwordPrompt;
  document.querySelector('#passwordSection p').textContent = translations[currentLang].enterPassword;
  document.getElementById('submitPassword').textContent = translations[currentLang].submit;

  // Update accommodation texts if elements exist
  if (document.getElementById('accommodationBtnText')) {
    document.getElementById('accommodationBtnText').textContent = translations[currentLang].accommodationBtn;
  }

  if (document.getElementById('accommodationTitle')) {
    document.getElementById('accommodationTitle').textContent = translations[currentLang].accommodationTitle;
  }

  // Update "View on Map" text for all hotel cards if they exist
  const mapLinks = document.querySelectorAll('.hotel-map a');
  if (mapLinks.length > 0) {
    mapLinks.forEach(link => {
      link.textContent = translations[currentLang].viewMap;
    });
  }
}

/**
 * Show the invitation and hide the password section
 */
function showInvitation() {
  document.getElementById('passwordSection').style.display = 'none';
  document.querySelector('.invitation').style.display = 'block';

  // Apply translations to visible elements
  document.querySelector('h1.wedding-title').textContent = translations[currentLang].weddingTitle;
  document.querySelector('h2.join-us').textContent = translations[currentLang].joinUs;
  document.querySelector('.footer-text').textContent = translations[currentLang].lookForward;

  // Show/hide ceremony section based on invitation type
  if (invitationType === 'reception') {
    // Hide ceremony section
    document.querySelector('.ceremony').style.display = 'none';
    // Hide the small divider between ceremony and reception
    document.querySelector('.divider.small').style.display = 'none';

    // Update invitation wording for reception-only guests if needed
    if (currentLang === 'en') {
      document.querySelector('h2.join-us').textContent = 'Please join us for our wedding reception';
    } else if (currentLang === 'sv') {
      document.querySelector('h2.join-us').textContent = 'Vi bjuder in er till vår bröllopsfest';
    }
  } else {
    // Show ceremony section for full invitation
    document.querySelector('.ceremony').style.display = 'block';
    document.querySelector('.divider.small').style.display = 'block';
    document.querySelector('.ceremony-title').textContent = translations[currentLang].ceremony;
  }

  // Always show reception section
  document.querySelector('.reception-title').textContent = translations[currentLang].reception;

  // Update RSVP text but keep the date
  const rsvpElement = document.querySelector('.rsvp');
  rsvpElement.textContent = translations[currentLang].rsvpPrefix;
}

async function generateHash(password, saltRounds = 10) {
    return new Promise((resolve, reject) => {
        dcodeIO.bcrypt.genSalt(saltRounds, function(err, salt) {
            if (err) {
                reject(err);
                return;
            }

            dcodeIO.bcrypt.hash(password, salt, function(err, hash) {
                if (err) {
                    reject(err);
                    return;
                }
                resolve(hash);
            });
        });
    });
}

document.addEventListener('DOMContentLoaded', function() {
  // Set up language switcher buttons
  const langButtons = document.querySelectorAll('.lang-btn');
  langButtons.forEach(btn => {
    btn.addEventListener('click', function(e) {
      e.preventDefault();
      const newLang = this.getAttribute('data-lang');

      // Create a new URL object based on current location
      const url = new URL(window.location);

      // Update only the language parameter, keeping all others
      url.searchParams.set('lang', newLang);

      // Navigate to the new URL
      window.location = url.toString();
    });

    // Highlight current language
    if (btn.getAttribute('data-lang') === currentLang) {
      btn.style.textDecoration = 'underline';
    }
  });
});


